Defendant Nicolas J. Rost in court, in custody with attorney Annamarie Amy Wineke.  Yolanda J. Tienstra appeared for the State of Wisconsin. Ct. heard, questions parties on revocation packet. Atty Wineke heard, Def. is fighting the fact that he sold items and had contact w/ the minor, althought Def. waived the hearing and understands that he is revoked. Ct. heard in response, comments are well placed but this is not a hearing about details contained in packet. Def. and Atty Tienstra have no corrections. Ct. finds victim rights compliance. Atty Tienstra heard. Ct. heard, finds 133 days present. credit. Atty Wineke heard. Def. makes statement. Ct. heard, imposes sent.:

5 yrs DCI;
2 IC; 3 ES to run consecutive w/ any other sentence, including Winnebago cases 14CF603 and 14CF578;
Eligible for Challenge Incarceration and Substance Abuse Programs;
Restitution to be paid - 25% of any money generated by Def., not to come out of canteen acct.;
Actively participate in any drug or alcohol treatment recommened by Agent;
Not possess any controlled substance w/o valid Rx, and only take pursant to Rx;
Costs.

Defendant Nicolas J. Rost in court with attorney Matthew E. Weil.  Yolanda J. Tienstra appeared for the State of Wisconsin. Agreement reached. Court reviews rights, charges and penalties. Def enters Guilty plea to Ct 2 & 3. Court accepts pleas and finds guilty of Ct 2 & 3; Ct 1 & 4 are DRI. Victim rights compliance. ADA Tienstra heard. Atty Weil heard. Court heard and imposes sentence:

3 yrs probation w/h;
(Ct 2) 30 days DCJ w/h&t conditional, consecutive, IMPOSED & STAYED - to be used at the discretion of the agent;
(Ct 2) $4768.92 to victims (7 total);
Write a meaningful letter to victim, submitted to Court;
Participate in counseling as determined by agent and comply with Winnebago Alcohol/Drug Court;
120 hours community service (40 hours each year) specifically with elderly or developmentally disabled;
Costs;
